SELECT ?subject ?country ?aar WHERE {
?subject rdf:type <http://dbpedia.org/ontology/birthPlace>.
?subject <http://dbpedia.org/ontology/birthPlace> ?country.
?subject <http://dbpedia.org/ontology/birthDate> ?aar.
}
LIMIT 20

